import React from 'react';
import {
  VStack,
  Text,
  Card,
  CardBody,
  SimpleGrid,
  useColorModeValue,
  Box,
  HStack,
  Badge,
} from '@chakra-ui/react';

interface GoalSelectionProps {
  selectedGoal?: 'weight_loss' | 'maintenance' | 'muscle_gain';
  onGoalSelect: (goal: 'weight_loss' | 'maintenance' | 'muscle_gain') => void;
}

const GoalSelection: React.FC<GoalSelectionProps> = ({
  selectedGoal,
  onGoalSelect,
}) => {
  const selectedBg = useColorModeValue('teal.50', 'teal.900');
  const selectedBorder = useColorModeValue('teal.500', 'teal.300');
  const hoverBg = useColorModeValue('gray.50', 'gray.700');

  const goalOptions = [
    {
      value: 'weight_loss' as const,
      emoji: 'üî•',
      title: 'Ï≤¥Ï§ë Í∞êÎüâ',
      subtitle: 'Í±¥Í∞ïÌïú Îã§Ïù¥Ïñ¥Ìä∏',
      description: 'Í≥ºÌïôÏ†ÅÏù∏ ÏπºÎ°úÎ¶¨ Í≥ÑÏÇ∞ÏúºÎ°ú Í±¥Í∞ïÌïòÍ≤å Ï≤¥Ï§ëÏùÑ Ï§ÑÏó¨Î≥¥ÏÑ∏Ïöî',
      features: ['ÏπºÎ°úÎ¶¨ 20% Í∞êÏÜå', 'Îã®Î∞±Ïßà ÎπÑÏú® Ï¶ùÍ∞Ä', 'Í∑ºÏÜêÏã§ Î∞©ÏßÄ'],
      color: 'red',
      timeframe: 'Ï£ºÎãπ 0.5kg Í∞êÎüâ',
    },
    {
      value: 'maintenance' as const,
      emoji: '‚öñÔ∏è',
      title: 'Ï≤¥Ï§ë Ïú†ÏßÄ',
      subtitle: 'Í∑†ÌòïÏû°Ìûå ÏãùÎã®',
      description: 'ÌòÑÏû¨ Ï≤¥Ï§ëÏùÑ Ïú†ÏßÄÌïòÎ©¥ÏÑú Í±¥Í∞ïÌïú ÏòÅÏñë Í∑†ÌòïÏùÑ ÎßûÏ∂∞Î≥¥ÏÑ∏Ïöî',
      features: ['ÌòÑÏû¨ ÏπºÎ°úÎ¶¨ Ïú†ÏßÄ', 'Í∑†ÌòïÏû°Ìûå ÏòÅÏñëÏÜå', 'Í±¥Í∞ïÌïú ÎùºÏù¥ÌîÑÏä§ÌÉÄÏùº'],
      color: 'green',
      timeframe: 'Ï≤¥Ï§ë ÌòÑÏÉÅ Ïú†ÏßÄ',
    },
    {
      value: 'muscle_gain' as const,
      emoji: 'üí™',
      title: 'Í∑ºÏÑ±Ïû•',
      subtitle: 'ÌÉÑÌÉÑÌïú Î™∏Îß§',
      description: 'Ï∂©Î∂ÑÌïú ÏòÅÏñëÏúºÎ°ú Í∑ºÏú°ÏùÑ ÌÇ§Ïö∞Í≥† ÌÉÑÌÉÑÌïú Î™∏Îß§Î•º ÎßåÎì§Ïñ¥Î≥¥ÏÑ∏Ïöî',
      features: ['ÏπºÎ°úÎ¶¨ 15% Ï¶ùÍ∞Ä', 'Îã®Î∞±Ïßà ÎπÑÏú® ÏµúÏ†ÅÌôî', 'Í∑ºÏú° ÏÑ±Ïû• Ï¥âÏßÑ'],
      color: 'blue',
      timeframe: 'Ïõî 0.5-1kg Ï¶ùÎüâ',
    },
  ];

  return (
    <VStack spacing={6} align="stretch">
      <VStack spacing={2} textAlign="center">
        <Text fontSize="4xl">üéØ</Text>
        <Text fontSize="2xl" fontWeight="bold" color="gray.800">
          Ïñ¥Îñ§ Î™©ÌëúÍ∞Ä ÏûàÏúºÏã†Í∞ÄÏöî?
        </Text>
        <Text color="gray.600">
          Î™©ÌëúÏóê Îî∞Îùº ÏµúÏ†ÅÏùò ÏπºÎ°úÎ¶¨ÏôÄ ÏòÅÏñëÏÜå ÎπÑÏú®ÏùÑ Í≥ÑÏÇ∞Ìï¥ÎìúÎ†§Ïöî
        </Text>
      </VStack>

      <SimpleGrid columns={{ base: 1, md: 3 }} spacing={4}>
        {goalOptions.map((option) => (
          <Card
            key={option.value}
            cursor="pointer"
            onClick={() => onGoalSelect(option.value)}
            bg={selectedGoal === option.value ? selectedBg : 'white'}
            borderWidth={selectedGoal === option.value ? '2px' : '1px'}
            borderColor={selectedGoal === option.value ? selectedBorder : 'gray.200'}
            _hover={{
              bg: selectedGoal === option.value ? selectedBg : hoverBg,
              transform: 'translateY(-4px)',
              shadow: 'xl',
            }}
            transition="all 0.3s"
            height="full"
          >
            <CardBody p={6}>
              <VStack spacing={4} align="stretch" height="full">
                {/* Ìó§Îçî */}
                <VStack spacing={2}>
                  <Text fontSize="4xl">{option.emoji}</Text>
                  <Text fontSize="xl" fontWeight="bold" textAlign="center">
                    {option.title}
                  </Text>
                  <Badge colorScheme={option.color} fontSize="sm">
                    {option.subtitle}
                  </Badge>
                </VStack>

                {/* ÏÑ§Î™Ö */}
                <Text fontSize="sm" color="gray.600" textAlign="center" lineHeight="1.5">
                  {option.description}
                </Text>

                {/* ÏòàÏÉÅ Í≤∞Í≥º */}
                <Box bg="gray.50" p={3} borderRadius="md">
                  <Text fontSize="xs" fontWeight="bold" color="gray.700" mb={1}>
                    ÏòàÏÉÅ Í≤∞Í≥º:
                  </Text>
                  <Text fontSize="xs" color="gray.600">
                    {option.timeframe}
                  </Text>
                </Box>

                {/* ÌäπÏßï */}
                <VStack spacing={1} align="stretch" flex={1}>
                  <Text fontSize="xs" fontWeight="bold" color="gray.700">
                    ÌäπÏßï:
                  </Text>
                  {option.features.map((feature, index) => (
                    <HStack key={index} spacing={2}>
                      <Text fontSize="xs" color={`${option.color}.500`}>
                        ‚úì
                      </Text>
                      <Text fontSize="xs" color="gray.600">
                        {feature}
                      </Text>
                    </HStack>
                  ))}
                </VStack>
              </VStack>
            </CardBody>
          </Card>
        ))}
      </SimpleGrid>

      <Box bg="blue.50" p={4} borderRadius="md" border="1px" borderColor="blue.200">
        <Text fontSize="sm" color="blue.800" textAlign="center">
          üí° ÏÑ†ÌÉùÌïòÏã† Î™©ÌëúÎäî Ïñ∏Ï†úÎì†ÏßÄ Î≥ÄÍ≤ΩÌï† Ïàò ÏûàÏñ¥Ïöî. 
          Î™©ÌëúÏóê Îî∞Îùº ÏπºÎ°úÎ¶¨ÏôÄ ÏòÅÏñëÏÜå ÎπÑÏú®Ïù¥ ÏûêÎèôÏúºÎ°ú ÏµúÏ†ÅÌôîÎê©ÎãàÎã§.
        </Text>
      </Box>
    </VStack>
  );
};

export default GoalSelection;
